import React, { Component } from 'react';
import Connexion from './connexion';
import { Row,Col, Jumbotron } from 'react-bootstrap';

class Home extends Component {
    render() {

        return (
            <div>
                <Row>
                    <Jumbotron>
                        <h1>Home page</h1>
                        <Connexion />
                    </Jumbotron>
                </Row>
                <Row>
                    <h2>Presentation</h2>
                </Row>
                <Row>
                    <h2>Feed</h2>
                    <p>Latest published requests</p>
                    <p>Latest fulfilled requests</p>
                    <p>New members</p>
                </Row>
            </div>
        )
    }
}
  
export default Home;
